// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import '@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol';
import "@openzeppelin/contracts/access/Ownable.sol";
import "./IDistributionContract.sol";

contract DistributionContract is IDistributionContract, Ownable {
    using SafeERC20 for IERC20; 

    string ERROR_AMMOUNT_IS_ZERO = "The transaction amount is zero";

    IERC20 public _token;
    bool public _rewardsIsLocked;
    uint256 public _totalSupply;

    mapping(address => uint256) private _balances;

    event BeneficiaryBalanceChanged(address beneficiary, uint256 balanceBefore, uint256 balanceAfter);
    event TotalSupplyChanged(uint256 totalSupplyBefore, uint256 TotalSuppleAfter);
    event LockRewards(bool rewardsIsLocked);
    event Deposit(address from, uint256 amount);

    constructor(IERC20 token) {
        require(address(token) != address(0), "The address of the contract should not be zero");
        _token = token;
    }


    /**
     * @dev Should transfer tokens from owner to distribution contract.
     * Can only be called by the current owner.
     * Emits an {Approval} event
     * @param amount Amount of tokens
     */
    function deposit(uint256 amount) external onlyOwner {
        require(amount > 0, ERROR_AMMOUNT_IS_ZERO);

        uint256 totalSupplyBefore = _totalSupply;
        _totalSupply += amount;
        _token.safeTransferFrom(_msgSender(), address(this), amount);
        emit Deposit(_msgSender(), amount);
        emit TotalSupplyChanged(totalSupplyBefore, _totalSupply);

    }

    //Rewards should be increased for the beneficiaries.
    //Can be called only by the owner
    function addBeneficiaries(address[] calldata beneficiaries, uint256[] calldata amounts) external onlyOwner {
        require(beneficiaries.length == amounts.length, "The number of items in the array of beneficiaries and the amounts must match");

        for (uint256 i = 0; i < beneficiaries.length; i++) {
            addBeneficiary(beneficiaries[i], amounts[i]);
        }
    }

    //Rewards should be increased for the beneficiary.
    //Can be called only by the owner
    function addBeneficiary(address beneficiary, uint256 amount) public onlyOwner {
        require(beneficiary != address(0), "Reward amount increased for zero address");
        require(amount > 0, ERROR_AMMOUNT_IS_ZERO);

        uint256 balanceBefore = _balances[beneficiary];
        _balances[beneficiary]  += amount;
        emit BeneficiaryBalanceChanged(beneficiary, balanceBefore, _balances[beneficiary]);
    }

    //Should decrease the amount of rewards for a beneficiary.
    //Can be called only by the owner
    function decreaseReward(address beneficiary, uint256 amount) external onlyOwner {
        require(beneficiary != address(0), "Reward amount reduced for zero address");
        require(amount > 0, ERROR_AMMOUNT_IS_ZERO);
        require(_balances[beneficiary] >= amount, "Decrease amount of rewards exceeds balance");

        uint256 balanceBefore = _balances[beneficiary];
        _balances[beneficiary]  -= amount;
        emit BeneficiaryBalanceChanged(beneficiary, balanceBefore, _balances[beneficiary]);
    }

    //Should transfer amount of reward tokens back to the owner.
    //Can be called only by the owner
    function emergencyWithdraw(uint256 amount) external onlyOwner {
        require(amount > 0, ERROR_AMMOUNT_IS_ZERO);
        require(_totalSupply >= amount, "Withdraw amount of rewards exceeds balance");

        uint256 totalSupplyBefore = _totalSupply;
        _token.safeTransfer(msg.sender, amount);
        emit TotalSupplyChanged(totalSupplyBefore, _totalSupply);
    }

    //Should lock/unlock rewards for beneficiaries?
    //Can be called only by the owner
    function lockRewards(bool lock) external onlyOwner {
        _rewardsIsLocked = lock;
        emit LockRewards(_rewardsIsLocked);
    }

    //Should transfer reward tokens to beneficiary. Without parameters.
    function claim() public {
        require(_rewardsIsLocked == false, "Rewards for beneficiaries has locked");
        require(_totalSupply >= _balances[msg.sender], "Not enough tokens in the contract");

        uint256 totalSupplyBefore = _totalSupply;
        _totalSupply -= _balances[msg.sender];
        _balances[msg.sender] = 0;
        _token.safeTransfer(msg.sender, _balances[msg.sender]);     
        emit TotalSupplyChanged(totalSupplyBefore, _totalSupply);
    }

    function balanceOf(address account) external view returns (uint256) {
        return _balances[account];
    }

}

